import React from "react";
import "./styles.css";


function carCard(props) {
    console.log("CARD",props.carsInfo)

    return (
        <>
        {props.carsInfo.length !== 0 ? (
            props.carsInfo.map(({ carid, maker, model, kilometers, estimatedate, description }) => {
                return (
                    <div className="card">
                        <img className="card-img-top" src="..." alt="" />
                        <div className="card-body">
                            <h5 className="card-title">Card id: {carid}</h5>
                            <p className="card-text">Description: {description}</p>
                        </div>
                        <ul className="list-group list-group-flush">
                            <li className="list-group-item">Maker: {maker}</li>
                            <li className="list-group-item">Model: {model}</li>
                            <li className="list-group-item">kilometers: {kilometers}</li>
                            <li className="list-group-item">Estimate date: {estimatedate}</li>
                            <li className="list-group-item"><i class="fas fa-tools"></i></li>
                        </ul>
                        {/* <div className="card-body">
                            
                        </div> */}
                    </div>
                )
            })
            
        ) : (
            <></>
        )}
    </>
    )
}

export default carCard;
